import Header from './Header';
import Main from './Main';
import Map from './Map';
import axios from 'axios';
export default function DashBoard(props)
{   // --- Generare vector cu id-urile spot-urilor favorite :
    /*const api = axios.create({
      baseURL: `https://627e1ec9b75a25d3f3b21451.mockapi.io`});
  
       const respone = axios.get('/favourites')
       .then(function (response) {
         return response.data;
       })
       .catch(function (error) {
         console.log(error);
       })
     console.log(respone.data)
     const userFavourites=[]*/
  // ---------------------------------------------------------
  const [userFavourites,setUserFavourites] = React.useState([])
  function makeGetRequest(path) {
    axios.get(path).then(
        (response) => {
            setUserFavourites(response.data)
        },
        (error) => {
            console.log(error);
        }
    );
    }
    makeGetRequest('https://627e1ec9b75a25d3f3b21451.mockapi.io/favourites');
    return(
        <div className="DashBoard">
            <Header Logout={props.Logout}/>
            <Main userFavourites={userFavourites} name={props.name}/>
        </div>
    )
}
